window.bookSummaryJSON = "<p>Splitting the party is never a good idea, but sometimes, that's just the hand fate deals you.</p> <p>On Nazere, the gang's plans are cast into the wind when a stubborn foe returns to settle a score.</p> <p>Back in Cardinia, Stacy has her hands full trying to help Dave, while Dave does everything in his power to avoid being helped.</p> <p>Tim and Cooper stagger out of the desert, to find themselves in a whole new world of trouble.</p> <p>As everyone explores new parts of this vast fantasy world, they encounter new friends and foes...and run into some they've met before. Set sail for adventure with galleons of seamen!</p>"; 
